    [],nt"revision_timestamp": "2016-10-15T16:36:20.931682",nt"name": "eastern-neck-national-wildlife-refuge-annual-narrative-report-calendar-year-1985",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Eastern
    Neck NWR outlines Refuge accomplishments during the 1985 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses management planning and research and
    investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, haying,
    fire management, pest control, and wilderness areas. The wildlife section of the
    report discusses wildlife diversity, endangered and threatened species, waterfowl,
    migratory birds, game mammals, marking and bird banding, and disease prevention
    and control. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, recreational uses, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, and equipment replacement. Photographs are attached.",nt"license_title":
